import React from 'react';
import { navStyle } from '../navStyle';
import Button from 'react-bootstrap/Button';
import Navbar from 'react-bootstrap/Navbar';
import Nav from 'react-bootstrap/Nav';

class Navigation extends React.Component {

  render() {

    let { color, backgroundColor, brand } = navStyle;

    return (
      <div>
        {/*<Navbar style={{backgroundColor}}>*/}
            {/*<Navbar.Brand style={brand} href="#home">Personal Capital</Navbar.Brand>*/}
            {/*<Navbar.Collapse id="basic-navbar-nav" className="justify-content-end">*/}
                {/*<Nav.Item>*/}
                  {/*<Nav.Link style={{color}} href="/home">Financial Tools</Nav.Link>*/}
                {/*</Nav.Item>*/}
                {/*<Nav.Item>*/}
                  {/*<Nav.Link style={{color}} eventKey="link-1">Wealth Management</Nav.Link>*/}
                {/*</Nav.Item>*/}
                {/*<Nav.Item>*/}
                  {/*<Nav.Link style={{color}} eventKey="link-2">About</Nav.Link>*/}
                {/*</Nav.Item>*/}
                {/*<Nav.Item>*/}
                  {/*<Nav.Link style={{color}} eventKey="link-2">Resources</Nav.Link>*/}
                {/*</Nav.Item>*/}
                {/*<Nav.Item>*/}
                  {/*<Button href="#">Login</Button>*/}
                {/*</Nav.Item>*/}
                {/*<Nav.Item>*/}
                  {/*<Button href="#">Sign Up</Button>*/}
                {/*</Nav.Item>*/}
            {/*</Navbar.Collapse>*/}
        {/*</Navbar>*/}
        <Navbar bg="light" expand="lg">
          <Navbar.Brand href="#home">React-Bootstrap</Navbar.Brand>
          <Navbar.Toggle aria-controls="basic-navbar-nav" />
          <Navbar.Collapse id="basic-navbar-nav">
            <Nav className="mr-auto">
              <Nav.Link href="#home">Home</Nav.Link>
              <Nav.Link href="#link">Link</Nav.Link>
              <NavDropdown title="Dropdown" id="basic-nav-dropdown">
                <NavDropdown.Item href="#action/3.1">Action</NavDropdown.Item>
                <NavDropdown.Item href="#action/3.2">Another action</NavDropdown.Item>
                <NavDropdown.Item href="#action/3.3">Something</NavDropdown.Item>
                <NavDropdown.Divider />
                <NavDropdown.Item href="#action/3.4">Separated link</NavDropdown.Item>
              </NavDropdown>
            </Nav>
            <Form inline>
              <FormControl type="text" placeholder="Search" className="mr-sm-2" />
              <Button variant="outline-success">Search</Button>
            </Form>
          </Navbar.Collapse>
        </Navbar>;
      </div>
    )
  }
}

export default Navigation;
